import React from 'react'
// register Swiper custom elements
register();





function Slider() {
  return (
    <swiper-container slides-per-view="1" speed="1500" loop="true" css-mode="true">
      <swiper-slide lazy="true"><img src="../img/slider/1.webp" loading="lazy"/></swiper-slide>
      <swiper-slide lazy="true"><img src="../img/slider/2.webp" loading="lazy"/></swiper-slide>
      <swiper-slide lazy="true"><img src="../img/slider/3.webp" loading="lazy"/></swiper-slide>
      <swiper-slide lazy="true"><img src="../img/slider/3.webp" loading="lazy"/></swiper-slide>
    </swiper-container>
  )
}

export default Slider
